import React from 'react';
import { YMaps, Map, Placemark } from 'react-yandex-maps';

function MyMap() {
  return (
    <YMaps>
      <Map defaultState={{ center: [55.75, 37.57], zoom: 9 }}>
        <Placemark geometry={[55.75, 37.57]} />
      </Map>
    </YMaps>
  );
}

export default MyMap;
